import Toast from 'react-bootstrap/Toast';

function PopUp() {
  return (
    <div>
      <Toast>
        <Toast.Header>This is the Title</Toast.Header>
      </Toast>
      <Toast.Body>Body Text</Toast.Body>
    </div>
  );
}

export default PopUp;
